        private static void DoTest(string wkt, double lengthRatio)
        {
            var geom = new WKTReader().Read(wkt);
            int numGeometries = geom.NumGeometries;
            Assert.That(geom.IsValid, Is.True);
            var flt = new UniquePointFilter(1e-9);
            geom.Apply(flt);
            geom = flt.GetResult(geom.Factory);
            TestContext.WriteLine($"Original {numGeometries} pts, filtered only {geom.NumGeometries} pts.");

            Geometry concaveHull = null;
            Assert.That(() => concaveHull = Algorithm.Hull.ConcaveHull.ConcaveHullByLengthRatio(geom, lengthRatio, true), Throws.Nothing);
            Assert.That(concaveHull.IsValid, Is.True);
            TestContext.WriteLine($"{lengthRatio}: {concaveHull.AsText()}");
        }

        private class UniquePointFilter : IGeometryFilter
        {
            private readonly KdTree<CoordinateSequence> _tree;
            private readonly Envelope _env;

            public UniquePointFilter() : this(0)
            {
            }

            public UniquePointFilter(double snappingDistance)
            {
                if (snappingDistance < 0)
                    throw new System.ArgumentOutOfRangeException(nameof(snappingDistance));
                _tree = new KdTree<CoordinateSequence>(snappingDistance);
                _env = new Envelope();
            }

            public void Filter(Geometry geom)
            {
                if (geom is MultiPoint mp)
                {
                    var pts = new Point[mp.NumGeometries];
                    for (int i = 0; i < mp.NumGeometries; i++)
                        pts[i] = (Point)mp.GetGeometryN(i);
                    Shuffle(new Random(17), pts);

                    for (int i = 0; i < pts.Length; i++)
                        _tree.Insert(pts[i].Coordinate, pts[i].CoordinateSequence.Copy());
                    _env.ExpandToInclude(geom.EnvelopeInternal);
                }
                return;
            }

            private class ShuffleIndex
            {
                private static Random Rnd = new Random(13);
                private int _n;

                public ShuffleIndex(int n)
                {
                    _n = n;
                }

                public int GetNextIndex()
                {
                    if (_n >= 0)
                    {

                    }
                        return -1;

                }
            }

            public static void Shuffle(Random rng, Point[] array)
            {
                int n = array.Length;
                while (n > 1)
                {
                    int k = rng.Next(n--);
                    var temp = array[n];
                    array[n] = array[k];
                    array[k] = temp;
                }
            }
            public Geometry GetResult(GeometryFactory factory)
            {
                var pts = _tree.Query(_env).Select(t => factory.CreatePoint(t.Data)).ToArray();
                return factory.CreateMultiPoint(pts);
            }
        }
